import { Form, Input } from 'antd';
import React, { FC } from 'react';

export const LoginForm: FC = () => {
  return (
    <Form>
      <div>
        <label htmlFor='user-id'>ID</label>
        <br />
        <Form.Item>
          <Input name='user-id' />
        </Form.Item>
      </div>
    </Form>
  );
};
